  selector: 'app-visiteur',
  templateUrl: './visiteur.component.html',
  styleUrls: ['./visiteur.component.scss']
})
export class VisiteurComponent {

  @Input() visiteur!:Visiteur;

  constructor(private route:Router) { }
}
